            if (schedulePickupUSPSResponse.PickupTotalWeightOption.IsSet)
                writer.WriteNumber("pickupTotalWeight", schedulePickupUSPSResponse.PickupTotalWeightOption.Value!.Value);

            if (schedulePickupUSPSResponse.PickupTotalWeightUnitOption.IsSet)
                writer.WriteString("pickupTotalWeightUnit", schedulePickupUSPSResponse.PickupTotalWeightUnit);
        }
    }
}
